import React from 'react'
import {useRef} from "react"
function SignUp() {
    let userName = useRef();
    let userPassword = useRef();

  return (
      <>
          <input ref={userName} type="text" />
          <input ref={userPassword} type="password" name="" id="" />
    </>
  )
}

export default SignUp
